import React from 'react';

// Image
import img1 from '../../../public/img/high/airbnb-background.jpg';

export default () => {
  return (
    <div>
      <div className='flex items-center justify-start'>
        <img src={img1} />
        <div>
          <p className='font-semibold'>Maureen</p>
          <p>October 2019</p>
        </div>
      </div>
    </div>
  );
};
